import StockRowDetail from './sub_component/StockRowDetail';

const StockDisplayer = ({ filteredStocks, setNewQuantity, handleQuantitySubmit }) => {
    return (
        <div className='display-content'>
            <h3>List of Stocks</h3>

            <table>
                <thead className='table-header'>
                    <tr>
                        <td>ID</td>
                        <td>Image</td>
                        <td>Name</td>
                        <td>Type</td>
                        <td>Quantity (max 100)</td>
                        <td>Supplier</td>
                        <td>In-stock</td>
                        <td>Note</td>
                    </tr>
                </thead>

                <tbody>
                    {filteredStocks ? filteredStocks.map((stock, key) => <StockRowDetail key={key}
                                                                        stock={stock} 
                                                                        setNewQuantity={setNewQuantity} 
                                                                        handleQuantitySubmit={handleQuantitySubmit} />) : <tr><td>Searching..</td></tr>}
                </tbody>

            </table>
        </div>
    );
}

export default StockDisplayer;
